import React from "react";
import styled from "styled-components";

const SidebarContainer = styled.aside``;

const Sidebar = () => {
  return (
    <SidebarContainer>
      <nav>
        <ul>
          <li>메뉴 1</li>
          <li>메뉴 2</li>
          <li>메뉴 3</li>
        </ul>
      </nav>
    </SidebarContainer>
  );
};

export default Sidebar;
